window.bookSummaryJSON = "<p><b><i>The Fifth Season: Booktrack Edition</i></b><b> adds an immersive musical soundtrack to your audiobook listening experience!</b></p> <p><b>At the end of the world, a woman must hide her secret power and find her kidnapped daughter in this \"intricate and extraordinary\" (</b><b><i>The New York Times</i></b><b>) Hugo Award-winning novel of power, oppression, and revolution.</b></p> <p>This is the way the world ends...for the last time.</p> <p>It starts with the great red rift across the heart of the world's sole continent, spewing ash that blots out the sun. It starts with death, with a murdered son and a missing daughter. It starts with betrayal, and long dormant wounds rising up to fester.</p> <p>This is the Stillness, a land long familiar with catastrophe, where the power of the earth is wielded as a weapon. And where there is no mercy.</p> <p><b>Listen to the first book in the critically acclaimed, three-time Hugo award-winning trilogy by </b><b><i>NYT </i></b><b>best-selling author N. K. Jemisin.</b></p> <p>Booktrack is an immersive format that pairs traditional audiobook narration to complementary music. The tempo and rhythm of the score are in perfect harmony with the action and characters throughout the audiobook. Gently playing in the background, the music never overpowers or distracts from the narration, so listeners can enjoy every minute. When you purchase this Booktrack edition, you receive the exact narration as the traditional audiobook available, with the addition of music throughout.</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
